package com.js.springmvc2;

public class Data3 {

	private int x;
	private int y;
	private String sign;
	
	public Data3() {
		// TODO Auto-generated constructor stub
	}

	public Data3(int x, int y, String sign) {
		super();
		this.x = x;
		this.y = y;
		this.sign = sign;
	}
	
	public String getSign() {
		return sign;
	}

	public void setSign(String sign) {
		this.sign = sign;
	}

	public int getX() {
		return x;
	}

	public void setX(int x) {
		this.x = x;
	}

	public int getY() {
		return y;
	}

	public void setY(int y) {
		this.y = y;
	}
}
